import React, { Fragment, useState } from "react";
import YearGridSmall from "./yearGridSmall";
import "../css/yearPanelSmall.css";

function YearPanelSmall(props) {
  return (
    <div className="yearPanelSmallDiv">
      <div className="controlerss">
        <button onClick="sortLight()">Sort Light</button>
        <button onClick="sortDay()">Sort Date</button>
        <button onClick="groupMonth()">Group Months</button>
      </div>

      <div className="header">
        <h4 className="year">{props.year}</h4>
        <button> x </button>
        <button> > </button>
      </div>

      {/* <div className="yearGridContainer">
        <YearGridSmall year={props.year} />
      </div> */}
    </div>
  );
}

export default YearPanelSmall;
